import { View, Text } from "react-native";
import React from "react";
import { Box, Center, Container, ScrollView, VStack } from "native-base";

const HomeScreen = () => {
  return (
    <ScrollView>
      <VStack borderWidth={1} w={200}></VStack>
    </ScrollView>
  );
};

export default HomeScreen;
